// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwSidenav from 'viewmodel/AwSidenavViewModel';
import AwServerVisibilityCommandBar from 'viewmodel/AwServerVisibilityCommandBarViewModel';
import AwFooter from 'viewmodel/AwFooterViewModel';
import { ExistWhen,AwClass } from 'js/hocCollection';
const AwSidenavExistWhen = ExistWhen(AwSidenav);
const MainAwClass = AwClass('main');
const NavExistWhen = ExistWhen('nav');
const AwFooterExistWhen = ExistWhen(AwFooter);



/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/wcagService', () => import('js/wcagService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "sideNavLeftData": {
            "slide": "FLOAT",
            "direction": "RIGHT_TO_LEFT",
            "animation": false,
            "width": "STANDARD",
            "height": "FULL"
        },
        "sideNavRightData": {
            "slide": "PUSH",
            "direction": "LEFT_TO_RIGHT",
            "animation": false,
            "width": "STANDARD",
            "height": "FULL"
        }
    },
    "actions": {
        "applyFocusOnMain": {
            "actionType": "JSFunction",
            "method": "applyFocusOnMain",
            "deps": "js/wcagService"
        },
        "updateArialabelForDuplicateLandmarks": {
            "actionType": "JSFunction",
            "method": "updateArialabelForDuplicateLandmarks",
            "deps": "js/wcagService"
        },
        "initializeWcag": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "applyFocusOnMain"
                },
                {
                    "action": "updateArialabelForDuplicateLandmarks"
                }
            ]
        }
    },
    "lifecycleHooks": {
        "onMount": "initializeWcag"
    },
    "props": {
        "sub-location-preference": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        }
    },
    "i18n": {
        "rightHandToolBar": [
            "UIElementsMessages"
        ]
    },
    "_viewModelId": "AwSublocation",
    "_uniqueViewModelId": "AwSublocation",
    "ctx": {
        "mselected": {
            "type": "object"
        },
        "pselected": {
            "type": "object"
        }
    }
};

/*
<div class='aw-layout-defaultSublocation aw-layout-flexColumn'>
    <div class='aw-layout-sublocationContainer'>
        <aw-sidenav id='aw_navigation' config="data.sideNavRightData"
            exist-when='!props.subLocationPreference.hideNavigationArea' sub-panel-context='props.subPanelContext'>
        </aw-sidenav>
        <div class='aw-layout-workarea'>
            <div class='aw-layout-flexbox'>
                <main
                    aw-class="[{'aw-layout-workareaMain':true}, { 'vertical': props.subLocationPreference && props.subLocationPreference.orientation === 'HORIZONTAL' }]">
                    {props.children}
                </main>
                <aw-sidenav id='aw_toolsAndInfo' config="data.sideNavLeftData"
                    exist-when='!props.subLocationPreference || !props.subLocationPreference.hideToolsAndInfoArea'
                    sub-panel-context='props.subPanelContext'>
                </aw-sidenav>
            </div>
        </div>
        <nav exist-when='!props.subLocationPreference.hideRightWall' aria-label='i18n.rightHandToolBar'
            class='aw-layout-flexCommandbar aw-layout-infoCommandbar'>
            <aw-server-visibility-command-bar anchor='aw_rightWall' alignment='VERTICAL' mselected='ctx.mselected'
                pselected='ctx.pselected' context='props.subPanelContext'
                class='aw-commands-nativeCommandBar aw-commands-commandBarContainer aw-commands-commandBarVertical'>
            </aw-server-visibility-command-bar>
        </nav>
    </div>
    <aw-footer class="afx-accent-background aw-footer-container" exist-when='!props.subLocationPreference.hideFooter' anchor="aw_footer" include-global="includeGlobalCommands"></aw-footer>
</div>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div className="aw-layout-defaultSublocation aw-layout-flexColumn">
        <div className="aw-layout-sublocationContainer">
            <AwSidenavExistWhen id="aw_navigation" config={AwParseService.instance( "data.sideNavRightData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "props.subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "!props.subLocationPreference.hideNavigationArea" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwSidenavExistWhen>
            <div className="aw-layout-workarea">
                <div className="aw-layout-flexbox">
                    <MainAwClass awClass={AwParseService.instance( "[{'aw-layout-workareaMain':true}, { 'vertical': props.subLocationPreference && props.subLocationPreference.orientation === 'HORIZONTAL' }]" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                        {props.children}
                    </MainAwClass>
                    <AwSidenavExistWhen id="aw_toolsAndInfo" config={AwParseService.instance( "data.sideNavLeftData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "props.subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "!props.subLocationPreference || !props.subLocationPreference.hideToolsAndInfoArea" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                    </AwSidenavExistWhen>
                </div>
            </div>
            <NavExistWhen aria-label={i18n.rightHandToolBar} className="aw-layout-flexCommandbar aw-layout-infoCommandbar" existWhen={AwParseService.instance( "!props.subLocationPreference.hideRightWall" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                <AwServerVisibilityCommandBar anchor="aw_rightWall" alignment="VERTICAL" mselected={AwParseService.instance( "ctx.mselected" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} pselected={AwParseService.instance( "ctx.pselected" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} context={AwParseService.instance( "props.subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} className="aw-commands-nativeCommandBar aw-commands-commandBarContainer aw-commands-commandBarVertical">
                </AwServerVisibilityCommandBar>
            </NavExistWhen>
        </div>
        <AwFooterExistWhen className="afx-accent-background aw-footer-container" anchor="aw_footer" include-global="includeGlobalCommands" existWhen={AwParseService.instance( "!props.subLocationPreference.hideFooter" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
        </AwFooterExistWhen>
    </div>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
